import { StyleSheet } from 'react-native'
import { fonts } from '../../theme'

const styles = StyleSheet.create({
  root: {
    flex: 1,
    flexDirection: 'column',
    justifyContent: 'center',
    alignContent: 'center',
  },
  content1: {
    alignItems: 'center',
  },
  content2: {
    marginTop: 100,
    alignItems: 'center',
  },
  title: {
    fontFamily: fonts.dancingScript.regularDS,
    fontSize: 60,
    color: 'white',
  },
  tinyLogo: {
    marginTop: 100,
    width: 180,
    height: 180,
  },
  login: {
    backgroundColor: 'transparent',
    borderColor: '#ffffff',
    borderStyle: 'solid',
    borderWidth: 1,
    borderRadius: 30,
    padding: 10,
    width: 200,
  },
  signup: {
    backgroundColor: '#ffffff',
    borderRadius: 30,
    marginTop: 20,
    padding: 10,
    width: 200,
  },
})

export default styles
